import React, { Component } from "react";
import {
  Button,
  Form,
  Header,
  Icon,
  Input,
  Message,
  Segment,
  Table
} from "semantic-ui-react";

const UserManagement = () => {
  return (
    <Segment>
      <Header>Registered Users</Header>
    </Segment>
  )
}

export default UserManagement;
